      <DIV id="id2_3">
        <P class="p29 ft6">Terms & Conditions</P>
        <P class="p30 ft19">
          <SPAN class="ft5">1.</SPAN>
          <SPAN class="ft18">Application form along with pay order, bank draft shall be submitted in favor of DEFENCE CITY at City/Site office. All subsequent payments shall be made as per schedule of payment and same be treated as part of these terms and conditions.</SPAN>
        </P>
        <P class="p31 ft3">
          <SPAN class="ft5">2.</SPAN>
          <SPAN class="ft20">A plot cannot be surrendered once it is allotted or transferred.</SPAN>
        </P>
        <P class="p32 ft19">
          <SPAN class="ft5">3.</SPAN>
          <SPAN class="ft18">The exact size and location of the plot will remain tentative and subject to adjustment till demarcation/measurement of the said plot at the time of possession.</SPAN>
        </P>
        <P class="p33 ft22">
          <SPAN class="ft5">4.</SPAN>
          <SPAN class="ft21">If the allottee fails to pay three successive installments, his provisional allotment will be cancelled. The paid amount shall be refunded after the deduction of 20% of the plot price within 3 months of cancellation, without any interest/markup against paid amount.</SPAN>
        </P>
        <P class="p31 ft3">
          <SPAN class="ft5">5.</SPAN>
          <SPAN class="ft20">Lump sum or installments payment will be as per the above mentioned payment plan.</SPAN>
        </P>
        <P class="p34 ft3">
          <SPAN class="ft5">6.</SPAN>
          <SPAN class="ft20">Installments received after due date will only be accepted subject to payment of surcharge @0.05% per day of the due installment.</SPAN>
        </P>
        <P class="p35 ft3">
          <SPAN class="ft5">7.</SPAN>
          <SPAN class="ft20">Development charges are inclusive in the plot price; however in case of any compulsive conditions customers will be informed.</SPAN>
        </P>
      </DIV>
    </DIV>
    <DIV id="page_3">
      <DIV id="p3dimg1">
        <IMG src="data:image/png;base64," id="p3img1">
      </DIV>
      <P class="p36 ft19">
        <SPAN class="ft5">8.</SPAN>
        <SPAN class="ft18">Development charges include the cost of main access road, sewerage, water supply and drainage whereas utilities and any other charges shall be obtained later.</SPAN>
      </P>
      <P class="p37 ft3">
        <SPAN class="ft5">9.</SPAN>
        <SPAN class="ft20">Unexpected increment in development charges may increase the price.</SPAN>
      </P>
      <P class="p38 ft19">
        <SPAN class="ft5">10.</SPAN>
        <SPAN class="ft18">10% premium will be charged for each preferential location. For example 30% premium will be charged for corner, boulevard location and facing park.</SPAN>
      </P>
      <P class="p29 ft3">
        <SPAN class="ft5">11.</SPAN>
        <SPAN class="ft20">In addition to the total amount, additional land charges will be applicable in case of extra land area in plot.</SPAN>
      </P>
      <P class="p39 ft19">
        <SPAN class="ft5">12.</SPAN>
        <SPAN class="ft18">One booking form can be used for seeking allotment of one plot only. For booking of more than one plot, separate forms to be used by the applicant</SPAN>
      </P>
      <P class="p40 ft22">
        <SPAN class="ft5">13.</SPAN>
        <SPAN class="ft21">All registration, sale agreement/mutation charges etc. or any other government taxes applicable on plot/development shall be borne by the provisional allottee.</SPAN>
      </P>
      <P class="p29 ft3">
        <SPAN class="ft5">14.</SPAN>
        <SPAN class="ft20">For any type of construction prior approval from DEFENCE CITY Design Wing will be mandatory</SPAN>
      </P>
      <P class="p40 ft22">
        <SPAN class="ft5">15.</SPAN>
        <SPAN class="ft21">In case of any dispute between the provisional allottee and DEFENCE CITY the dispute will be referred to the Administration Committee of DEFENCE CITY, whose decision shall be final and binding on both the parties. The parties do hereby bind to arbitration and exclude the intimation of any civil proceeding before the court of law.</SPAN>
      </P>
      <P class="p41 ft19">
        <SPAN class="ft5">16.</SPAN>
        <SPAN class="ft18">Every applicant shall abide by the </SPAN>
        <NOBR>bye-laws,</NOBR> rules and regulations, terms and conditions of DEFENCE CITY for possession, allotment, construction and transfer of plots etc.
      </P>
      <P class="p42 ft24">
        <SPAN class="ft5">17.</SPAN>
        <SPAN class="ft23">Possession and final allotment of the plot shall be given after all the complete payment(s) has been received including charges levied by DEFENCE CITY from time to time.</SPAN>
      </P>
      <P class="p43 ft22">
        <SPAN class="ft5">18.</SPAN>
        <SPAN class="ft21">Address given by the applicant in the application form shall be deemed to be proper address for any future correspondence and communication unless updated in DEFENCE CITY.</SPAN>
      </P>
      <P class="p29 ft3">
        <SPAN class="ft5">19.</SPAN>
        <SPAN class="ft20">Application form will be charged at PKR 500.00 each </SPAN>
        <NOBR>(non-refundable)</NOBR>
      </P>
      <P class="p29 ft3">
        <SPAN class="ft5">20.</SPAN>
        <SPAN class="ft20">Processing fee </SPAN>
        <NOBR>(non-refundable)</NOBR> for each 10 Marla residential plot is PKR 5,000.00.
      </P>
      <P class="p44 ft26">
        <SPAN class="ft5">21.</SPAN>
        <SPAN class="ft25">10% discount will be given on full lump sum payment (100% payment of the cost) as mentioned in this application form. However, the rest of the charges to be levied as mentioned above have to be paid by the applicant as and when applicable.</SPAN>
      </P>
